
public class Iteration {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=0;i<10;i++) {
			System.out.println("hii i have to cleared Upsc in 1st attempt");
		}
		int i=1;
		while(i<=5) {
			System.out.println("Hii i have to do agaiin");
			i++;
		}
		i=0;
		do {
			System.out.println(i);
			i++;
		} while (i<=5);

	}

}
